import classes from "./Skills.module.css";

const Skills = () => {
  let newList = [];

  const td = [
    {
      name: "Javascript",
    },
    {
      name: "Reactjs",
    },
    {
      name: "Redux",
    },
    {
      name: "HTML",
    },
    {
      name: "CSS",
    },
    {
      name: "GIT",
    },
    {
      name: "JSON",
    },
    {
      name: "SASS",
    },
    {
      name: "Figma",
    },
    {
      name: "SASS",
    },
    {
      name: "Stripe",
    },
    {
      name: "Github",
    },
    {
      name: "Bootstrap",
    },
    {
      name: "Responsive Design",
    },
  ];

  td.map((item) => {
    return newList.push(
      <td className={classes.td} key={Math.random()}>
        {item.name}
      </td>
    );
  });

  return (
    <div className={classes.container}>
      <h1>Skills</h1>
      <div className={classes.tr}>{newList}</div>
    </div>
  );
};

export default Skills;
